import { Dispatch, SetStateAction } from "react";
import {Guess} from "./Guess";


const CheckGuess = (
  words: string[],
  guess: Guess,
  idx: number,
  strikes: number,
  setIsCorrect: Dispatch<SetStateAction<boolean>>,
  setStrikes: Dispatch<SetStateAction<number>>
): boolean => {
  const correctWord = words[idx];
  const tOrF =
    new Set(correctWord).size === new Set(correctWord + guess.v + guess.c).size;
  setIsCorrect(tOrF);
  return tOrF;
};

export default CheckGuess;
